    "2016-11-25T21:06:31.014901",nt"name": "online-and-distance-education-at-postsecondary-institutions-200607",nt"isopen":
    true,nt"url": null,nt"notes": "Online and Distance Education at Postsecondary
    Institutions, 2006-07 (PEQIS 16), is a study that is part of the Postsecondary Education
    Quick Information System (PEQIS) program; program data is available since 1997 at
    <http://nces.ed.gov/surveys/peqis/>. PEQIS 16 (http://nces.ed.gov/pubsearch/pubsinfo.asp?pubid=2009044)
    is a survey that collects data on the prevalence and delivery of distance education
    courses in the 2006-07 12-month academic year, including the number of courses and
    enrollment for online courses, hybrid/blended online courses, and all other distance
    education courses. The survey also collects information about numbers of degree
    or certificate programs designed to be completed entirely through distance education
    and the technologies used for the instructional delivery of credit-granting distance
    education courses. The study was conducted using paper and web surveys. The weighted
    response rate was 87 percent.  Postsecondary institutions were sample for this study.
    Key statistics produced from PEQIS 16 relate to information on the prevalence, types,
    delivery, policies, and acquisition or development of distance education courses
    and programs.",nt"license_title": "Creative Commons CCZero",nt"extras":
